import React from "react";
import { Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

function Header() {
  return (
    <nav className="navbar navbar-light bg-light px-3 d-flex justify-content-between">
      <Link className="navbar-brand" to="/">
        To-Do List
      </Link>
      <div>
        <Link className="btn btn-outline-primary me-2" to="/">
          Головна
        </Link>
        <Link className="btn btn-outline-primary me-2" to="/about">
          Головна
        </Link>
        <Link className="btn btn-outline-secondary me-2" to="/tasks">
          Мої справи
        </Link>
        <button className="btn btn-danger">Вийти</button>
      </div>
    </nav>
  );
}

export default Header;
